## @file TestFlagGenerator.py
#  @title TestFlagGenerator
#  @brief Tests implementation of FlagGenerator for generating flag image
#         files from given input strings and hashing algorithm string names
#  @details Tests public functions
#  @author Nathaniel Hu
#  @date 2022-04-02

import pytest
from PIL import Image

from FlagGenerator import *


## @brief test cases for HashGenerator library module
class TestFlagGenerator:
    # initialize
    def setup_method(self, method):
        self.FG = FlagGenerator()
        self.correct_flag_data = []
        self.correct_flag_pixel_colour_map = []

    # reset
    def teardown_method(self, method):
        self.FG = None
        self.correct_flag_data = None
        self.correct_flag_pixel_colour_map = None

    # test generate_flag_data() method (normal case, for correctness)
    def test_generate_flag_data_0(self):
        # expected generated flag data from given input string and hashing
        # algorithm string name
        self.correct_flag_data = {"COLOURS": [(159, 134, 208), (129, 136, 76), (125, 101, 154), (47, 234, 160), (197, 90, 208)],
                                    "STRIPE_INFO": ('CROSS', 'THREE', 'CROSS_THIN'), "SYMBOL_INFO": ('CENTER', 'ONE', 'SWORD')}
        self.FG.generate_flag_data("test", "sha256")
        assert self.FG.colours == self.correct_flag_data["COLOURS"]
        assert self.FG.stripe_info == self.correct_flag_data["STRIPE_INFO"]
        assert self.FG.symbol_info == self.correct_flag_data["SYMBOL_INFO"]

    # test generate_flag_data() method (boundary case, for correctness)
    def test_generate_flag_data_1(self):
        # expected generated flag data from given input string and hashing
        # algorithm string name
        self.correct_flag_data = {"COLOURS": [(221, 70, 210), (12, 200, 169), (160, 219, 100), (129, 80, 104), (164, 47, 158)],
                                    "STRIPE_INFO": ('CROSS_SALTIRE', 'ONE', 'CROSS_SALTIRE_THIN'), "SYMBOL_INFO": ('CENTER', 'TWO', 'ROUNDEL')}
        self.FG.generate_flag_data('#@$%^&*()@!', 'sha384')
        assert self.FG.colours == self.correct_flag_data["COLOURS"]
        assert self.FG.stripe_info == self.correct_flag_data["STRIPE_INFO"]
        assert self.FG.symbol_info == self.correct_flag_data["SYMBOL_INFO"]

    # test generate_flag_data() method (boundary case, for correctness)
    def test_generate_flag_data_2(self):
        # expected generated flag data from given input string and hashing
        # algorithm string name
        self.correct_flag_data = {"COLOURS": [(212, 29, 140), (217, 143, 0), (178, 4, 233), (128, 9, 152), (236, 248, 66)],
                                    "STRIPE_INFO": ('SALTIRE', 'TWELVE', 'SALTIRE_THIN'), "SYMBOL_INFO": ('TOP_RIGHT', 'TWO', 'SWORD')}
        self.FG.generate_flag_data('', 'md5')
        assert self.FG.colours == self.correct_flag_data["COLOURS"]
        assert self.FG.stripe_info == self.correct_flag_data["STRIPE_INFO"]
        assert self.FG.symbol_info == self.correct_flag_data["SYMBOL_INFO"]

